  async function getData(){
    let resp=await fetch('https://www.flickr.com/services/rest/?method=flickr.photos.getRecent&api_key=54ef68ba48fc4d348ac9d00f3609423b&format=rest&api_sig=abd67fc39a7786df0f3299bd099324ec')
    let movie=await resp.json();
    console.log()
    setMovies(movie)
  }
  return (
    <div className="App">
        {getData()}
    </div>
  );
}

export default App;
